import React from "react";
import styled from "styled-components";
import PinterestIcon from "@mui/icons-material/Pinterest";
import Icon from "@mui/material/Icon";

function Header() {
  return (
    <div>
      <Wrapper>
        <LogoWrapper>
          <Icon>
            <PinterestIcon />
          </Icon>
        </LogoWrapper>

        <HomeButton>
          <a href="/">HomePage</a>
        </HomeButton>

        <Following>
          <a href="/">Following</a>
        </Following>
        {/*
        <SearchWrapper>
          <SearchBar>

          </SearchBar>
        </SearchWrapper>

<IconWrapper>

</IconWrapper>
*/}
      </Wrapper>
    </div>
  );
}

export default Header;

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  height: 56px;
  padding: 12px 5px 5px 16px;
  background-color: #ffff;
  color: black;
`;

const LogoWrapper = styled.div`
  .MuiSvgIcon-root {
    color: #e60023;
    font-size: 32px;
    cursor: pointer;
  }
`
const HomeButton=styled.div`
display:flex;
height:48px;
min-width:123px;
align-items:center;
justify-content:center;
border-radius:24px;
cursor:pointer;
background-color:rgb(17,17,17);

a{
  text-decoration:none;
  
}
`
